import React, {Component} from 'react'
import "./lookReport.css"
import reports from "./reports/reports";

class LookReport extends Component{
    state = {
        projects: [
            {
                name:[
                    {text: 'Проект №1'},
                    {text: 'Проект №2'}
                ],
                curator:[
                    {text:'Василий'},
                    {text:'Всеволод'}
                ]
            }
        ]
    }
   render(){
       return(
           <div>
               {this.state.reports.map((rep, index) => {
                   return(
                       <reports
                           key={index}
                           name={rep.name}
                           curator={rep.curator}
                       />
                   )
               })}
           </div>
       )
   }
}

export default LookReport
